import React, { useState, useEffect } from "react";

function Explore() {
  const [newspapers, setNewspapers] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5000/api/newspapers")
      .then((res) => res.json())
      .then((data) => setNewspapers(data))
      .catch((error) => console.error("Error fetching newspapers:", error));
  }, []);

  return (
    <div>
      <h1>Explore Newspapers</h1>
      <ul>
        {newspapers.map((paper) => (
          <li key={paper.id}>{paper.name} - â‚¹{paper.price_per_word} per word</li>
        ))}
      </ul>
    </div>
  );
}

export default Explore;
